import React from 'react'
import '../styles/Cat.css';

export const Cat = () => {
    const data = [
        {
            url: 'https://www.sephora.com/contentimages/categorybanners/RWD/icons/clean_guide.svg',
            h1: 'Minis'
        },
        {
            url: '',
            h1: 'Hair Styling &',
            h2: 'Treatments'
        },
        {
            url: '',
            h1: 'Foundation'
        },
        {
            url: '',
            h1: 'SPF'
        },
        {
            url: '',
            h1: 'Hair Masks'
        },
        {
            url: '',
            h1: 'Perfume'
        },
        {
            url: '',
            h1: 'Sephora',
            h2: 'Collection'
        },
        {
            url: '',
            h1: 'Soft',
            h2: 'Contoured',
            h3: 'Makeup'
        }
    ]
  return (
      <>
            <div className='cat-div'>
                <div className='cat-txt-div'>
                    <h1>Featued Categories</h1>
                    <p>Shop what's popular now.</p>
                </div>  
                    <div className='cat-btn-div'>
                    {data.map((items) => (
                    <span className='popup'>
                        <a href="">
                            <div className='cat-main'>
                                <h1>{items.h1}</h1>
                                <h1>{items.h2}</h1>
                                <h1>{items.h3}</h1>
                            </div>
                        </a>
                    </span>
                     ))}    
                </div>                      
            </div>
            <div className='cat-div'>
            <div className='cat-txt-div'>
                    <h1>Need a Little Guidance?</h1>
                    <p>Check out our 
                        <a style={{textDecoration:'underline'}} href="https://www.sephora.com/beauty/best-beauty-products?icid2=homepage_soft-links_guidance_us_rwd_060222"> quizzes and buying guides .</a>
                    </p>
                </div>  
                    <div className='cat-btn-div'>
                    {data.map((items) => (
                    <span className='popup'>
                        <a href="">
                            <div className='cat-main'>
                                <h1>{items.h1}</h1>
                                <h1>{items.h2}</h1>
                                <h1>{items.h3}</h1>
                            </div>
                        </a>
                    </span>
                     ))}    
                </div> 
            </div>
     </>
  )
}
